import React, { Component } from "react";
import HeaderOne from "./header";
import './css/register.css';
import Tsu from "./Photo/regImg.jpg"
import { NavLink } from "react-router-dom";

class Register extends Component {
    constructor(props) {
        super(props);
        this.state = {
            userInput: '',
            errorMessage: ''
        }
    }
    handleInputChange = (e) => {
        const input = e.target.value;
        
        // Use a regular expression to check if the input consists of only digits
        if (/^\d+$/.test(input)) {
          const number = parseInt(input, 10);
          if (number >= 1 && number <= 10) {
            this.setState({
              userInput: input,
              errorMessage: '',
            });
          } else {
            this.setState({
              errorMessage: 'Please enter a number between 1 and 10.',
            });
          }
        } else {
          this.setState({
            errorMessage: 'Please enter a valid number.',
          });
        }
      };
    render() {
    return(
        <div>
            <HeaderOne className="regHead"/>
            <div className="main-register">
                <div className="registration-form">
                    <h2>Sign Up</h2>
                    <form>
                        <div className="form-row">
                            <div>
                                <label htmlFor="Name">Name</label>
                                <input type="text" name="name" required/>
                            </div>
                            <div>
                                <label htmlFor="LastName">Last Name</label>
                                <input type="text" name="lastName" required/>
                            </div>
                        </div>
                        <div className="form-row">
                            <div>
                                <label htmlFor="password">Password</label>
                                <input type="password" name="password" required/>
                            </div>
                            <div>
                                <label htmlFor="repeatPassword">Repeat Password</label>
                                <input type="password" name="repeatPassword" required />
                            </div>
                        </div>
                        <div className="form-row">
                            <div>
                                <label htmlFor="Email">Email</label>
                                <input type="email" name="email" required />
                            </div>
                            <div>
                                <label htmlFor="PersonalN">Personal Number</label>
                                <input 
                                    type="type" 
                                    name="PersonalN" 
                                    required 
                                    value={this.state.userInput}
                                    onChange={this.handleInputChange}
                                />
                                <p style={{color: red}}>{this.state.errorMessage}</p>
                            </div>
                        </div>
                        <div className="form-row">
                            <div>
                                <label htmlFor="studentOrLecturer">I am ...</label>
                                <select name="studentOrLecturer" id="studentOrLecturer" required>
                                    <option value="student">Student</option>
                                </select>
                            </div>
                        </div>
                        <div className="button">
                            <input type="submit" name="signUp" value="SignUp" id="signUp" />
                        </div>
                    </form>
                    <p>Or if you already have an account</p>
                    <NavLink to="/">Log In</NavLink>
                </div>
                <img src={Tsu} alt="Tbilisi State University"></img>
            </div>
        </div>
    )
}
}

export default Register
